  <style>
    body {
      background-color: #f8f8f8;
    }

    a,
    a:hover,
    a:focus,
    .btn.btn-link {
      color: #990000;
    }

    .btn.btn-default,
    .btn.btn-default:hover,
    .btn.btn-default:focus,
    .btn.btn-default:active {
      border-color: #990000;
      color: #990000;
    }

    .btn.btn-primary,
    .btn.btn-primary:hover,
    .btn.btn-primary:focus,
    .btn.btn-primary:active {
      background-color: #990000;
      border-color: #990000;
      color: #FFF;
    }

    #navigation>.wf-content .wf-inbox,
    #navigation>.wf-content .wf-navigation-wrapper {
      background-color: #565656;
    }

    #navigation>.wf-content .list-group>.list-group-heading {
      color: rgba(255, 255, 255, .5);
    }

    .dropdown-menu>li>a:hover,
    .dropdown-menu>li>a:focus,
    .dropdown-menu>li>a:active,
    .list-group a.list-group-item:hover,
    .list-group a.list-group-item:focus,
    .list-group a.list-group-item.active,
    #navigation>.wf-content>.list-group a:hover,
    #navigation>.wf-content .btn-link:hover {
      background-color: #990000;
      color: #FFF;
    }

    .wf-page-header,
    #navigation>.wf-content .list-group>.wf-logo {
      background-color: #990000;
    }

    .wf-title,
    h1,
    h2,
    h3,
    h4,
    h5,
    h6 {
      color: #990000;
    }

    .wf-page-header>.wf-logo {
      background-image: url(/image/layout_set_logo?img_id=228611&amp;t=1498671767449);
    }

    .wf-steps-2>li {
      background: #f5f5f5;
      border: 1px solid #CCC;
      color: #CCC;
    }

    .wf-steps-2>li::before {
      background: #f5f5f5;
    }

    .wf-steps-2>li.active {
      background: #FFF;
      border-color: #990000;
      color: #990000;
    }

    .wf-steps-2>li.active::before {
      background: #FFF;
      border-color: #990000;
    }
  </style>
  <style>
    .btn {
      border-width: 2px;
      border-radius: 100px;
    }

    .wf-viewport {
      left: 0;
      right: 0;
      bottom: 0;
      top: 0;
      position: fixed;
      overflow: auto;
    }

    #diagram {
      transition: transform .8s;
      transform: translateX(-100%);
      background: #FFF;
      border-right: 1px solid #CCC;
    }

    .wf-btn-diagram,
    .wf-diagram-message {
      transition: transform .6s;
    }

    .wf-diagram-opened #diagram {
      transform: translateX(0);
    }

    .wf-diagram-opened .wf-btn-diagram,
    .wf-diagram-opened .wf-diagram-message {
      transform: translateX(-150%);
    }

    .wf-started .wf-diagram-message {
      display: none;
    }

    #diagram:not(.wf-maximize)>div {
      display: flex;
      align-items: center;
      justify-content: center;
    }

    #diagram:not(.wf-maximize) svg {
      flex: 1;
    }

    #diagram:not(.wf-maximize) #minimize {
      display: none;
    }

    #diagram.wf-maximize svg {
      width: 4208px;
    }

    #diagram.wf-maximize #maximize {
      display: none;
    }

    #diagram #close {
      position: fixed;
      right: 30px;
      top: 15px;
      padding: 11px 14px;
    }

    #diagram #maximize,
    #diagram #minimize {
      position: fixed;
      right: 84px;
      top: 15px;
      padding: 11px 14px;
    }

    #4931471e-cd05-46da-9052-eceaaa42e94a {
      cursor: pointer;
    }
  </style>

  <script src="libraries/jquery/dist/jquery.min.js"></script>
  <script src="libraries/bootstrap/dist/js/bootstrap.min.js"></script>
  <script>
    $(function() {
      var load = function(url) {
        $('body').removeClass('wf-diagram-opened').addClass('wf-started');
        setTimeout(function() {
          $('#viewer')[0].src = url;
        }, 400);
      };
      $('#open').on('click', function(e) {
        $('body').addClass('wf-diagram-opened');
      });
      $('#close').on('click', function(e) {
        $('body').removeClass('wf-diagram-opened');
      });
      $('#maximize').on('click', function(e) {
        $('#diagram').addClass('wf-maximize');
      });
      $('#minimize').on('click', function(e) {
        $('#diagram').removeClass('wf-maximize');
      });

      //Loan Request
      $('#4931471e-cd05-46da-9052-eceaaa42e94a').on('click', function(e) {
        load('loan-request-step1.html');
      });
      $('#39f5378b-7c39-47da-abee-de862e135ed9, #9a3bac83-05f7-48f9-b99b-a403bd844b9b, #47450ee2-2d23-453e-bb12-987dd4f78fc4, #47450ee2-2d23-453e-bb12-987dd4f78fc4').on('click', function(e) {
        load('loan-request-step5.html');
      });
      $('#376f09e4-5426-4ac3-a73f-85834ea4414b').on('click', function(e) {
        load('loan-request-approved.html');
      });

      //Verificacion
      $('#687837ae-e59f-4c28-aa61-fa13bbd8d13b').on('click', function(e) {
        load('loan-request-check.html?step=1');
      });
      $('#c8724ee2-dcf5-41a8-a770-1fd19876e436').on('click', function(e) {
        load('loan-request-check.html?step=2');
      });
      $('#da632cf4-1c0f-4b9e-855c-aa11d5d57bf1').on('click', function(e) {
        load('loan-request-check.html?step=3');
      });
      $('#14df411b-8a6a-4089-b61e-0ef4b32bfacf').on('click', function(e) {
        load('loan-request-check.html?step=4');
      });
      $('#c774cc12-fce8-43a1-a0c3-9ddca419889d').on('click', function(e) {
        load('loan-request-check.html?step=5');
      });
      $('#8a849731-e040-42d4-bade-3cd0b6cfbb98').on('click', function(e) {
        load('loan-request-check.html?step=6');
      });
      $('#b34c4139-1362-4728-8f30-af00fe3d4f7b').on('click', function(e) {
        load('loan-request-check.html?step=7');
      });
      $('#4cbd9d03-5cbf-4f3d-b1d9-eaba32319ed7').on('click', function(e) {
        load('loan-request-check.html?step=8');
      });
      $('#4423dc5a-0629-42e7-87ea-b6a93e249ec4').on('click', function(e) {
        load('loan-request-check.html?step=9');
      });
      $('#68d0a045-b838-4a3d-befc-036993db84b4').on('click', function(e) {
        load('loan-request-check.html?step=9.5');
      });
      $('#a6e9deb7-af25-4d5d-81cb-f88cf81194e5').on('click', function(e) {
        load('loan-request-check.html?step=10');
      });
      $('#ada454a2-0dbd-4b96-acd3-bb5e721546f6').on('click', function(e) {
        load('loan-request-check.html?step=11');
      });
      $('#a868ee92-4ad0-434c-b800-2982b90830f9, #66259262-212e-4012-b225-5a64a95a1e30').on('click', function(e) {
        load('loan-request-check.html?step=12');
      });
      $('#66259262-212e-4012-b225-5a64a95a1e30').on('click', function(e) {
        load('loan-request-check.html?step=13');
      });

      //Schedule
      $('#f8aaff57-ff3b-4ed9-bc4c-2671ce52117b').on('click', function(e) {
        load('loan-request-check.html?step=14');
      });

      //User Accept
      $('#ae777994-42e7-4494-b850-561dbfab2b28').on('click', function(e) {
        load('loan-request-accept.html');
      });

      $('#9b7df1ca-5d19-4b95-9553-b79b0023b358').on('click', function(e) {
        load('loan-request-check.html?step=15');
      });

      $('#4a227dcc-90f2-447f-afc0-4b49d0b9645c').on('click', function(e) {
        load('loan-request-check.html?step=16');
      });

      //Emails
      $('#e1a74cb9-0070-4382-b7e5-8006efb2f828').on('click', function(e) {
        load('loan-request-email-pre-approved.html');
      });
      $('#5eb0173e-4149-4101-85e6-2b7defedebfb').on('click', function(e) {
        load('loan-request-email-approved.html');
      });
      $(
        '#d72057e8-e670-41ed-ab78-6f0f98e443b6, #fd8ec051-8822-4c32-9819-0de8fd8d4ad4, #2daf596b-68d5-428c-b390-a50bd87c1fd7, #8838a349-5cc4-4c86-9356-c710eb4055af, #efd89f6e-332b-49cc-943a-cb943c87637a, #59ad7717-d7ee-4d44-8eb1-81f31017d0f9, #d6edd13e-5531-44a7-9d29-f09eef7db01c'
      ).on('click', function(e) {
        load('loan-request-email-declined.html');
      });
    });
  </script>
